  'terms.cookies.p1': '–ú—ã –∏—Å–ø–æ–ª—å–∑—É–µ–º —Ñ–∞–π–ª—ã cookie. –ò—Å–ø–æ–ª—å–∑—É—è AutoFix Image, –≤—ã —Å–æ–≥–ª–∞—à–∞–µ—Ç–µ—Å—å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Ñ–∞–π–ª—ã cookie –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–∏–∏ —Å –ü–æ–ª–∏—Ç–∏–∫–æ–π –∫–æ–Ω—Ñ–∏–¥–µ–Ω—Ü–∏–∞–ª—å–Ω–æ—Å—Ç–∏ AutoFix Image. –ë–æ–ª—å—à–∏–Ω—Å—Ç–≤–æ –∏–Ω—Ç–µ—Ä–∞–∫—Ç–∏–≤–Ω—ã—Ö –≤–µ–±-—Å–∞–π—Ç–æ–≤ –∏—Å–ø–æ–ª—å–∑—É—é—Ç —Ñ–∞–π–ª—ã cookie, —á—Ç–æ–±—ã –º—ã –º–æ–≥–ª–∏ –ø–æ–ª—É—á–∞—Ç—å –¥–∞–Ω–Ω—ã–µ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è –ø—Ä–∏ –∫–∞–∂–¥–æ–º –ø–æ—Å–µ—â–µ–Ω–∏–∏. –§–∞–π–ª—ã cookie –∏—Å–ø–æ–ª—å–∑—É—é—Ç—Å—è –Ω–∞—à–∏–º –≤–µ–±-—Å–∞–π—Ç–æ–º –¥–ª—è –æ–±–µ—Å–ø–µ—á–µ–Ω–∏—è —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª—å–Ω–æ—Å—Ç–∏ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–Ω—ã—Ö –æ–±–ª–∞—Å—Ç–µ–π, —á—Ç–æ–±—ã –æ–±–ª–µ–≥—á–∏—Ç—å –ø–æ—Å–µ—â–µ–Ω–∏–µ –Ω–∞—à–µ–≥–æ –≤–µ–±-—Å–∞–π—Ç–∞. –ù–µ–∫–æ—Ç–æ—Ä—ã–µ –∏–∑ –Ω–∞—à–∏—Ö –ø–∞—Ä—Ç–Ω–µ—Ä–æ–≤/—Ä–µ–∫–ª–∞–º–æ–¥–∞—Ç–µ–ª–µ–π —Ç–∞–∫–∂–µ –º–æ–≥—É—Ç –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Ñ–∞–π–ª—ã cookie.',
  'terms.license.title': '3. –õ–∏—Ü–µ–Ω–∑–∏—è',
  'terms.license.p1': '–ï—Å–ª–∏ –Ω–µ —É–∫–∞–∑–∞–Ω–æ –∏–Ω–æ–µ, AutoFix Image –∏/–∏–ª–∏ –µ–≥–æ –ª–∏—Ü–µ–Ω–∑–∏–∞—Ä—ã –≤–ª–∞–¥–µ—é—Ç –ø—Ä–∞–≤–∞–º–∏ –∏–Ω—Ç–µ–ª–ª–µ–∫—Ç—É–∞–ª—å–Ω–æ–π —Å–æ–±—Å—Ç–≤–µ–Ω–Ω–æ—Å—Ç–∏ –Ω–∞ –≤—Å–µ –º–∞—Ç–µ—Ä–∏–∞–ª—ã –≤ AutoFix Image. –í—Å–µ –ø—Ä–∞–≤–∞ –∏–Ω—Ç–µ–ª–ª–µ–∫—Ç—É–∞–ª—å–Ω–æ–π —Å–æ–±—Å—Ç–≤–µ–Ω–Ω–æ—Å—Ç–∏ –∑–∞—â–∏—â–µ–Ω—ã. –í—ã –º–æ–∂–µ—Ç–µ –ø–æ–ª—É—á–∏—Ç—å –¥–æ—Å—Ç—É–ø –∫ —ç—Ç–æ–º—É –∏–∑ AutoFix Image –¥–ª—è –≤–∞—à–µ–≥–æ –ª–∏—á–Ω–æ–≥–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è —Å —É—á–µ—Ç–æ–º –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏–π, —É—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–Ω—ã—Ö –≤ —ç—Ç–∏—Ö —É—Å–ª–æ–≤–∏—è—Ö –∏ –ø–æ–ª–æ–∂–µ–Ω–∏—è—Ö.',
  'terms.license.p2': '–í—ã –Ω–µ –¥–æ–ª–∂–Ω—ã:',
