  'terms.disclaimer.l1': '–æ–≥—Ä–∞–Ω–∏—á–∏–≤–∞—Ç—å –∏–ª–∏ –∏—Å–∫–ª—é—á–∞—Ç—å –Ω–∞—à—É –∏–ª–∏ –≤–∞—à—É –æ—Ç–≤–µ—Ç—Å—Ç–≤–µ–Ω–Ω–æ—Å—Ç—å –∑–∞ —Å–º–µ—Ä—Ç—å –∏–ª–∏ —Ç–µ–ª–µ—Å–Ω—ã–µ –ø–æ–≤—Ä–µ–∂–¥–µ–Ω–∏—è;',
  'terms.disclaimer.l2': '–æ–≥—Ä–∞–Ω–∏—á–∏–≤–∞—Ç—å –∏–ª–∏ –∏—Å–∫–ª—é—á–∞—Ç—å –Ω–∞—à—É –∏–ª–∏ –≤–∞—à—É –æ—Ç–≤–µ—Ç—Å—Ç–≤–µ–Ω–Ω–æ—Å—Ç—å –∑–∞ –º–æ—à–µ–Ω–Ω–∏—á–µ—Å—Ç–≤–æ –∏–ª–∏ –º–æ—à–µ–Ω–Ω–∏—á–µ—Å–∫–æ–µ –∏—Å–∫–∞–∂–µ–Ω–∏–µ —Ñ–∞–∫—Ç–æ–≤;',
